import React from 'react';
import { Form, Button } from 'antd';

const SubmitButton = (props) => {
    const { children } = props;
    return (
        <Form.Item>
            <Button type='primary'>
                {children};
            </Button>
        </Form.Item>
    )
}

export default SubmitButton;
